  content: 'I''m getting mixed messages in the discord, so thought I''d post this
    here. I''m struggling to get controlnet working with Mochi Diffusion. I''ve updated
    to Mochi Diffusion 4.0 through the `Check for updates...`menu item in the top
    nav dropdown.


    1. In `Settings` > Under `ControlNet Folder` Clicking the magnifying icon **does
    not do anything**

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/bt8xB0oG1zUKwoT_NPAdK.png)

    2. Opening up the folder using `Model Folder` instead, I see that no *controlnet*
    folder was created upon updating to Mochi Diffusion v4.0

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/uFnzJrCoPGtwDgvAN-WTK.png)

    3. I downloaded `DreamShaper v5.0  Original 768X768 For ControlNet` and ran it,
    hoping it would automatically create the missing controlnet folder (and alias,
    according to some user in Discord), still nothing.

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/eta7kfpxCHnfTfFk-H7ll.png)

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/VQGOCBXF2692Eso8gvW5u.png)

    4. I then made the folder structure manually, adding `controlnet` folder inside
    mochi diffusion, then downloading, unzipping and adding the openpose mlmodelc
    folder inside that.

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/wSvTe3N_4J9tnbkba8vbw.png)

    5. The ControlNet function is still **grayed out and** unusable in Mochi Diffusion
    and clicking the *magnifying icon* to open up the folder in `Settings` > Under
    `ControlNet Folder` still doesn''t do anything, indicating to me Mochi Diffusion
    is still not recognising ControlNet

    ![image.png](https://cdn-uploads.huggingface.co/production/uploads/63ec6db26ef3ce22b88b8a0a/O3rF9rqdFCDCD2XTDvqI9.png)


    Any guidance on getting this working would be greatly appreciated. As suggested
    in the Discord, perhaps a screenshot of the path/working folder structure might
    help others to manually get controlnet working with MochiDiffusion as a work around.'
