        html: '<p>An <code>.mlmodelc</code> file is actually a "package", which is
          basically a folder.  If I right click on my <code>Canny-5x5.mlmodelc</code>
          file, for example, I can select "Show Package Contents", and I get what
          you see in the screen cap below.  This is probably the same thing you see
          if you click on your <code>Canny-5x5.mlmodelc</code> folder.</p>

          <p>So the issue is that your system does not know that a <code>.mlmodelc</code>
          folder should be treated as a package.  Also when I right click on mine,
          I get an option to "Open With" Xcode.  So it is possible that one needs
          Xcode installed in order for the system to know that an <code>.mlmodelc</code>
          folder is to be treated as a package.  All of the developers who work on
          Mochi have Xcode installed, so it is possible we would not ever see them
          as folders, and if that is a problem with making them work, we would not
          know there is a problem.</p>

          <p>Is it really a problem, or are you just getting a different Finder display
          from me?  </p>

          <p>Does your Mochi not "see" and list the different ControlNet modules that
          you put in your <code>controlnet</code> folder when you try to use a ControlNet?
          </p>

          <p>Are you using one of the ControlNet capable base models from this repo
          when you try to use ControlNet?  (Your base model needs to have a <code>ControlledUnet.mlmodelc</code>
          in it, not just a <code>Unet.mlmodelc</code>.)</p>

          <p><a rel="nofollow" href="https://cdn-uploads.huggingface.co/production/uploads/63d957976b496a404a43bcc6/gMpcNUl-Mwkl1VNszvZXL.jpeg"><img
